var didScroll;
var lastScrollTop = 0;
var delta = 5;
var navbarHeight = $('.filterleft').outerHeight();
$(window).scroll(function(event) {
    didScroll = true;
});
setInterval(function() {
    if (didScroll) {
        hasScrolled();
        didScroll = false;
    }
}, 250);

function hasScrolled() {
    var st = $(this).scrollTop();
    if (Math.abs(lastScrollTop - st) <= delta) return;
    if (st > lastScrollTop && st > navbarHeight) {
        $('.filterleft').removeClass('filter-down').addClass('filter-up');
    } else {
        if (st + $(window).height() < $(document).height()) {
            $('.filterleft').removeClass('filter-up').addClass('filter-down');
        }
    }
    lastScrollTop = st;
}



