$("#product_faq_submit").click(function() {
     var reg_name = /^[A-Za-z ]*$/;
     var reg_email =
/^([A-Za-z0-9_\-\.])+\@([A-Za-z0-9_\-\.])+\.([A-Za-z]{2,4})$/;
     $(".form-control").css('border', '1px solid #e8e8e8');
     var question = $("#product_question").val();
     var name = $("#faq_name").val();
     var email = $("#faq_email").val();
     var city = $("#faq_city").val();
     var mobile = $("#faq_mobile").val();
     if($("#AskPid").val()){
     var pid = $("#AskPid").val();
        }else{
     var pid = $("#AskCid").val();
        }
     var return_val = true;
     if (email == '' || reg_email.test(email) == false) {
         $("#faq_email").css('border', '1px solid red');
         //$("#faq_email").focus();
         return_val = false;
     }
     if (name == '' || reg_name.test(name) == false) {
         $("#faq_name").css('border', '1px solid red');
         //$("#faq_name").focus();
         return_val = false;
     }
     if (question == '') {
         $("#product_question").css('border', '1px solid red');
         //$("#product_question").focus();
         return_val = false;
     }
     if (city == '') {
         $("#faq_city").css('border', '1px solid red');
         //$("#faq_city").focus();
         return_val = false;
     }
     if (mobile == '') {
         $("#faq_mobile").css('border', '1px solid red');
         //$("#faq_city").focus();
         return_val = false;
     }
     if (return_val == true) {
         var dataString = 'name=' + name + '&email=' + email + '&question=' + question + '&city=' + city + '&mobile=' + mobile + '&product_id=' + pid;
         $.ajax({
             type: 'POST',
             url: 'index.php?route=product/product/submitproductfaq',
             data: dataString,
             cache: false,
             success: function(data) {
                 $(".form-control").css('border', '1px solid #e8e8e8');
                 $(".form-control").val('');
                 $("#success_msg_faq").css('color', 'green');
                 $("#success_msg_faq").html('Your Question is successfully submitted.');
             }
         });
     }
});


function add_comma(x) {
    x = x.toString();
    var lastThree = x.substring(x.length - 3);
    var otherNumbers = x.substring(0, x.length - 3);
    if (otherNumbers != '') lastThree = ',' + lastThree;
    var res = otherNumbers.replace(/\B(?=(\d{2})+(?!\d))/g, ",") + lastThree;
    return res;
}
  
