        function submit_request() {
            $("#request_name").css('border', '1px solid #e2e1e1');
            $("#request_email").css('border', '1px solid #e2e1e1');
            $("#request_phone").css('border', '1px solid #e2e1e1');
            $("#request_callback").css('border', '1px solid #e2e1e1');
            $("#request_message").css('border', '1px solid #e2e1e1');

            var name = $("#request_name").val();
            var email = $("#request_email").val();
            var phone = $("#request_phone").val();
            var request_callback = $("#request_callback_time option:selected").text();
            var message = $("#request_message").val();
            var url = $(".antispam").val();

            var reg_name = /^[A-Za-z ]*$/;
            var reg_email = /^([A-Za-z0-9_\-\.])+\@([A-Za-z0-9_\-\.])+\.([A-Za-z]{2,4})$/;
            var reg_number = /^[0-9-  ]*$/;

            var dataString = 'name=' + name + '&email=' + email + '&phone=' + phone + '&request_callback=' + request_callback + '&message=' + message + '&url=' + url;

            if (name == '' || reg_name.test(name) == false) {
                $("#request_name").css('border', '1px solid red');
                $("#request_name").attr('placeholder', 'Please enter name');
                $("#request_name").focus();
            }

            else if (email == '' || reg_email.test(email) == false)
            {
                $("#request_email").css('border', '1px solid red');
                $("#request_email").focus();

            }
            else if (phone == '' || reg_number.test(phone) == false)
            {
                $("#request_phone").css('border', '1px solid red');
                $("#request_phone").focus();
            }

            else if (message == '')
            {
                $("#request_message").css('border', '1px solid red');
                $("#request_message").focus();
            }

            else {

                //$("#error").html("<div style='text-align:center;'><img src='images/loading.gif' style='width:50px;height:50px'></div>");
                $.ajax({
                    type: "POST",
                    url: "mail.php",
                    data: dataString,
                    cache: false,
                    success: function (data) {

                        $(".request-success").html('Thank you for showing interest!');
                        $("#request_name").val('');
                        $("#request_email").val('');
                        $("#request_phone").val('');
                        $("#request_callback").val('');
                        $("#request_message").val('');
                        $("#request_message").removeClass('red-placeholder');
                        $("#request_phone").removeClass('red-placeholder');
                        setTimeout(function () {
                            $('.close').click();
                        }, 3000);
                    }
                });
            }
            return false;

        }
