$(".productnew li").hover(function(){
    getHoverFabric($(this));
     $(this).find('.text').show();
},function(){
    $(this).find('.text').hide();
});

//EMI 
function getEmiPopup(d){
     $.ajax({
         url:'emi.php',
         dataType : 'html',
         type:'POST',
         data:{spcl:d},
         success: function(emi){
         $('#emi_list').html(emi);
         $(".tabs .tab-links a").on("click", function(e) {
             var i = $(this).attr("href");
             $(".tabs " + i).show().siblings().hide(), $(this).parent("li").addClass("active").siblings().removeClass("active"),
e.preventDefault()
         })
         $('.swpmodal-close').click(function(){
         $('#emi_list').swpmodal("close");
         return false;
         });
         }
     })
}
//Sticky everyone 
if (WinWidth >= 767) {
$(document).ready(function(){
    $("#review-sidebar").stick_in_parent({offset_top: 60});
});
}

//Input focus style
$(window).ready(function(){
  $(".col-3 .form-control").val("");
  $(".input-effect .form-control").focusout(function(){
    if($(this).val() != ""){
      $(this).addClass("has-content");
    }else{
    $(this).removeClass("has-content");
    }
  });
});

